async function graphfetch(){const t=[],a=[],e=[],s=[],l=await fetch("../static/SAP.csv"),i=await fetch("../static/RELIANCE.NS.csv"),o=await fetch("../static/IBM.csv"),r=await l.text(),n=await i.text(),c=await o.text(),p=r.split("\n").slice(1),d=n.split("\n").slice(1),b=c.split("\n").slice(1);return p.forEach(e=>{const s=e.split(","),l=s[0];t.push(l);const i=s[1];a.push(72*parseFloat(i))}),d.forEach(t=>{const a=t.split(",")[1];e.push(a)}),b.forEach(t=>{const a=t.split(",")[1];s.push(72*parseFloat(a))}),{xlabels:t,ytemps:a,ytemps2:e,ytemps3:s}}async function createChart(){const t=await graphfetch(),a=document.getElementById("chart").getContext("2d");console.log("temps",t.ytemps2);var e={labels:t.xlabels,datasets:[{label:"SAP",data:t.ytemps,fill:!0,backgroundColor:"rgba(255, 99, 132, 0.2)",borderColor:"rgba(255, 99, 132, 1)",borderWidth:1,pointStyle:"triangle",pointRadius:3},{label:"RELIANCE",data:t.ytemps2,fill:!0,backgroundColor:"rgba(44, 130,201, 0.2)",borderColor:"rgba(44, 130, 201, 1)",borderWidth:1},{label:"IBM",data:t.ytemps3,fill:!0,backgroundColor:"rgba(247, 202, 24, 0.2)",borderColor:"rgba(247, 202, 24, 1)",borderWidth:1,pointStyle:"circle"}]},s={responsive:!0,maintainAspectRatio:!1,scales:{calculateX:0,xAxes:[{gridLines:{display:!1}}],yAxes:[{ticks:{max:11500,min:7e3,stepSize:100},gridLines:{display:!1},scaleLabel:{display:!0,labelString:"Amount (â‚¹)"}}]}};new Chart(a,{type:"line",data:e,options:s});setInterval((function(){setData(e.datasets[0].data),setData(e.datasets[1].data),setLabels(e.labels);new Chart(a,{type:"line",data:e,options:s})}),2e3)}